"geo_spoofing_steps_to_disable" : "1. Close all apps which are providing mock location;

2. Go to 'Developer Options';

3. Select 'Nothing' in 'Select mock location app'."

"geo_spoofing_steps_to_disable" : "1. Fermez toutes les applications qui fournissent un emplacement simulé;

2. Allez dans « Options du développeur »;

3. Sélectionnez « Rien » dans « Sélectionner l'application de localisation simulée »."

"geo_spoofing_steps_to_disable" : "1. Cierra todas las aplicaciones que estén proporcionando una ubicación simulada;

2. Ve a 'Opciones del desarrollador';

3. Selecciona 'Nada' en 'Seleccionar aplicación de ubicación simulada'."
